function PrintReceipt(n){n!=null&&$.ajax({url:"/Orders/PrintReceipt/"+n,type:"GET",success:function(n){var t=n;t.responseCode==CODES.RESPONSE_CODE_OK?sweetAlert.success({title:"Printed!",text:t.responseMessage}):t.errorCode==CODES.RESPONSE_CODE_ERROR?sweetAlert.error({text:t.errorMessage}):t.responseCode==CODES.RESPONSE_CODE_NOTFOUND&&sweetAlert.error({text:t.responseMessage})},error:function(n){console.log(n);sweetAlert.error({text:"An error Occured while Printing Receipt."})}})}function CancelOrder(n){n!=null&&sweetAlert.confirm({showCancelButton:!0},function(t){t&&$.ajax({url:"/Orders/Cancel/"+n,type:"GET",success:function(n){var t=n;console.log("response",t);t.responseCode==CODES.RESPONSE_CODE_OK?($(".order-status").html('<span class="red">Cancelled<\/span>'),$(".btn-print-receipt").remove(),$(".btn-cancel-order").remove(),sweetAlert.success({title:"Cancelled!",text:t.responseMessage})):t.errorCode==CODES.RESPONSE_CODE_ERROR?sweetAlert.error({text:t.errorMessage}):t.responseCode==CODES.RESPONSE_CODE_NOTFOUND&&sweetAlert.error({text:t.responseMessage})},error:function(n){console.log(n);sweetAlert.error({text:"An error Occured while Cancelling Order."})}})})}